import React from 'react';

function User({user}) {
  return (
  <div>
   <b>{users[user].username}</b><span>({users[user].email})</span>
  </div>
  )
}

function UserList () {
  const users = [
    {
      id: 1,
      username: 'rkdud',
      email:'hap@ss',
      active: true,
    },
    {
      id: 2,
      username: 'kyuha',
      email:'pro@nn',
      active: false,
    },
    {
      id: 3,
      username: 'kiki',
      email:'love@dd',
      active: false,
    }
  ]

  return (
    <User />
  )

}

export default UserList;
